// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Header';
import About from './About';

function App() {
  return (
    <Router>
      <div className='App'>
        <div className="Header" >
          <Header />
        </div>

        <div className="About">
          <Switch>
            <Route path="/about">
              <About />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
